import { useParams } from 'react-router-dom'
import './App.css'
import Division from './Division'

function Home(){
    const { name } = useParams();

    // Add a null/undefined check for the 'name' variable
    const arr = name ? name.split(" ") : [];

    const RYE = () => {
        alert(arr[0]+" "+arr[1]);
    };

    localStorage.setItem("nme", arr[0]);
    localStorage.setItem("email", arr[1]);

    return (
        <>
            <Division />
            <div className='image'>
                <h1>Welcome </h1>
                <button onClick={RYE}>Hello</button>
            </div>
        </>
    );
}

export default Home;
